const brand_1 = require('../images/partner-1.png');
const brand_2 = require('../images/partner-2.png');
const brand_3 = require('../images/partner-3.png');
const brand_4 = require('../images/partner-4.png');
const brand_5 = require('../images/partner-5.png');

const brandSlider = [
    {
        img: brand_1
    },
    {
        img: brand_2
    },
    {
        img: brand_3
    },
    {
        img: brand_4
    },
    {
        img: brand_5
    },
]

export default brandSlider;
